import React, { useEffect, useState } from 'react';
import moment from 'moment';

const SelectDate = ({
    incomingdate,
    typeOne,
    onHandleChangeEvent
}) => {
    const [date, setDate] = useState();
    console.log("incomingdate",incomingdate);
    const resultDate=moment(incomingdate).format('YYYY-MM-DD');
    return(
        <div>
            <input 
                value={resultDate}
                type="date" 
                name={typeOne} 
                onChange={(e)=>{setDate(e.target.value); onHandleChangeEvent(e)}}
            />
        </div>
    );
}
export default SelectDate;
